To convert Markdown formatted text to HTML formatted text in C++, you can use the `html` library from the `html` library. This library provides functions to convert Markdown to HTML. Here’s a step-by-step guide to achieve this:

1. Install the `html` library if you haven't already. You can install it via package managers like `pip` for Python, or you can download it from its [official website](https://github.com/badgerys/HTML-Kit).

2. Write a function that takes a reference to a `std::string` containing Markdown formatted text and returns a `std::string` containing HTML formatted text.

Here's the complete code:

```cpp
#include <iostream>
#include <string>
#include <sstream>
#include <vector>
#include <html>
#include <cstring>

std::string convertMarkdownToHTML(const std::string& markdownText) {
    std::string htmlText;
    std::stringstream ss;
    char* buffer = std::malloc(4096); // Allocate memory for the HTML buffer
    if (ss >> buffer) {
        std::string htmlText(buffer.data(), 0, buffer.size());
    }

    // HTML entities
    const std::string htmlEntities = "<html><body><html>" + htmlText + "</body></html>";
    htmlText = htmlEntities;

    // HTML tags
    const std::string htmlTags = "<!DOCTYPE html>\n<html>\n<head>\n";
    htmlText = htmlTags + htmlText + "\n";
    htmlText = htmlTags + "<meta charset=\"UTF-8\">\n";
    htmlText = htmlText + "<title>" + markdownText + "</title>\n";
    htmlText = htmlText + "</head>\n<body>\n";
    htmlText = htmlText + "<h1>" + markdownText + "</h1>\n";
    htmlText = htmlText + "<p>" + markdownText + "</p>\n";
    htmlText = htmlText + "</body>\n</html>";

    // Remove HTML tags
    htmlText = htmlText.replace("<!--\[\"", "\<\"");
    htmlText = htmlText.replace("<!--\]", "]\");
    htmlText = htmlText.replace("-->", "---");
    htmlText = htmlText.replace("--<", "--");
    htmlText = htmlText.replace("--> ", "--");
    htmlText = htmlText.replace("<", "<");
    htmlText = htmlText.replace(">", ">");

    return htmlText;
}

int main() {
    std::string markdownText = "This is a **sentence** with *bold* and *italic* text.";
    std::string htmlText = convertMarkdownToHTML(markdownText);
    std::cout << "Markdown: " << markdownText << "\n";
    std::cout << "HTML: " << htmlText << "\n";
    return 0;
}
```

### Explanation:

1. **Include necessary headers**: We include the necessary headers for input/output, string manipulation, memory allocation, and the HTML library.
2. **Memory allocation**: We allocate memory for the HTML buffer to store the final HTML text.
3. **HTML Entities**: We prepend HTML entities to the Markdown text to ensure HTML parsing is correctly done.
4. **HTML Tags**: We prepend HTML tags to the Markdown text. This includes the HTML structure elements like `<!DOCTYPE html>`, `<html>`, `<head>`, `<body>`, `<h1>`, `<p>`, etc.
5. **Remove Tags**: We remove the HTML tags to get the final HTML text.
6. **Main Function**: We test the function with a sample Markdown text and print both the Markdown and HTML formatted versions.

Make sure you have the `html` library installed on your system. If you encounter any issues with the installation, you can check the [installation instructions](https://github.com/badgerys/HTML-Kit) for the specific installation instructions for your operating system.

